    const iContext = useContext(ItemContext);

    const VariantFunctions = {

        GetVariants: () => {
            if (iContext.item) {
                if (iContext.item.variants) {
                    return iContext.item.variants;
                }
            }
        }
    }

    return (
        <div className='itemvariants itemvariants--primary'>
            h2.
        </div>
    )
}

